INSERT INTO `vr_titles` VALUES (2,'TheBlu','the-blu','Experience the wonder and majesty of the ocean through a series of habitats and come face to face with some of the most awe inspiring species on the planet.','','0','E',1,1,'https://store.steampowered.com/app/451520/theBlu/',1,1,'2021-06-16 14:37:34','2024-05-23 06:35:57','451520','C:\\Program Files (x86)\\Steam\\steamapps\\common\\theBlu\\theblu.exe',1,1,0,0,0),(3,'GORN','gorn','GORN is a ludicrously violent VR gladiator simulator, made by Free Lives, the developers of Broforce and Genital Jousting.','','0','M',1,1,'https://store.steampowered.com/app/578620/GORN/',1,1,'2021-06-16 15:19:33','2024-05-23 06:35:57','578620','C:\\Program Files (x86)\\Steam\\steamapps\\common\\GORN\\GORN.exe',1,1,0,0,0),(4,'Job Simulator','job-simulator','In a world where robots have replaced all human jobs, step into the \"Job Simulator\" to learn what it was like \'to job\'.','','0','E',1,1,'https://store.steampowered.com/app/448280/Job_Simulator/',1,1,'2021-06-16 15:30:49','2024-05-23 06:35:57','448280','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Job Simulator\\JobSimulator.exe',1,1,0,0,0),(5,'Richies Plank Experience','richies-plank-experience','You\'re on a plank, 80 stories high. Knees shaky, palms sweaty. You have a choice. Do you walk or do you freeze? Richie\'s Plank is the only VR experience that lets you clone any real-world plank into the virtual world for 2X the immersion.','','0','E',1,1,'https://store.steampowered.com/app/517160/Richies_Plank_Experience/',1,1,'2021-06-16 15:35:58','2024-05-23 06:35:57','517160','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Richie\'s Plank Experience\\RichiesPlankExperience.exe',1,1,0,0,0),(6,'Space Pirate Trainer','space-pirate-trainer','Space Pirate Trainer is the official trainer for wannabe space pirates in VR. Pick up your blasters, put on your sneakers, and dance your way into the Space Pirate Trainer hall of fame.','','0','T',1,1,'https://store.steampowered.com/app/418650/Space_Pirate_Trainer/',1,1,'2021-06-16 15:45:54','2024-05-23 06:35:57','418650','D:\\program files\\steam library\\steamapps\\common\\Space Pirate Trainer VR\\SpacePirateVR.exe',1,1,0,0,0),(7,'Summer Funland','summer-funland','Get ready for the awesome VR experience that is Summer Funland! Spectacular attractions and pure fun abound. A crazy rollercoaster, hilarious mini-games, an incredibly fast-paced motorcycle ride through Gotham, underwater voyage and space trip – Summer Funland will blow you away!','','0','E',1,1,'https://store.steampowered.com/app/780280/Summer_Funland/',1,1,'2021-06-16 15:47:56','2024-05-23 06:35:57','780280','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Summer Funland\\Summer Funland.exe',1,1,0,0,0),(8,'SUPERHOT','superhot','Lose track of what’s real. Commit yourself, body and mind. Confront the evocative, elegantly brutal world of SUPERHOT VR. Enemies pouring into the room from all sides, dozens of bullets coursing through the air... Wait. Something seems different in here...','','0','T',1,1,'https://store.steampowered.com/app/617830/SUPERHOT_VR/',1,1,'2021-06-16 15:50:54','2024-05-23 06:35:57','617830','C:\\Program Files (x86)\\Steam\\steamapps\\common\\SUPERHOT VR\\SUPERHOTVR.exe',1,1,0,0,0),(9,'Vacation Simulator','vacation-simulator','The latest VR sensation from the creators of platinum hit ‘Job Simulator’, now with free DLC ‘Back to Job’! Welcome to the Vacation Simulator: a rough approximation of VACATION inspired by real human NOT JOBBING. Reallocate your bandwidth and get ready to splash, s’more, snowball, and selfie your way to optimal relaxation.','','0','E',1,1,'https://store.steampowered.com/app/726830/Vacation_Simulator/',1,1,'2021-06-16 15:52:47','2024-05-23 06:35:57','726830','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Vacation Simulator - LBE Edition\\Vacation Simulator.exe',1,1,0,0,0),(10,'Arizona Sunshine','arizona-sunshine','Virtual reality meets the zombie apocalypse! Arizona Sunshine® is a first-person shooter built exclusively for VR that immerses you and up to three fellow survivors in a post-apocalyptic southwestern America overrun by zombies. When you hear a flash of a human voice on the radio, your hopes surge - there are survivors out in the blistering heat of the post-apocalyptic Grand Canyon state! Armed with little more than your motion-controlled weapons and the scarce ammo and consumables you find along the way, you need to navigate the hordes of zombies coming for your brain in your desperate search for survivors.','Built exclusively for VR, Arizona Sunshine® puts you and up to 3 fellow survivors in the midst of a zombie apocalypse. Survive solo or in co-op, handle weapons with real-life movements, and explore a post-apocalyptic world in VR. Putting the undead back to rest is more thrilling than ever before.','0','M',1,4,'https://store.steampowered.com/app/342180/Arizona_Sunshine/',1,1,'2021-06-16 15:56:21','2024-05-23 06:35:57','342180','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Arizona Sunshine Arcade\\ArizonaSunshine.exe',1,1,1,0,0),(11,'Beat Saber','beat-saber','Beat Saber is an immersive rhythm experience you have never seen before! Enjoy tons of handcrafted levels and swing your way through the pulsing music beats, surrounded by a futuristic world. Use your sabers to slash the beats as they come flying at you – every beat indicates which saber you need to use and the direction you need to match. With Beat Saber you become a dancing superhero!','Beat Saber is a VR rhythm game where you slash the beats of adrenaline-pumping music as they fly towards you, surrounded by a futuristic world.','0','E',1,5,'https://store.steampowered.com/app/620980/Beat_Saber/',0,1,'2021-06-16 16:00:12','2024-05-23 06:35:57','620980','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Beat Saber\\Beat Saber.exe',1,1,1,0,0),(12,'Creed: Rise to Glory','creed-rise-to-glory','Challenge both your body and mind as you experience the ascent of Adonis Creed from undiscovered underdog to world-class fighter, all within an immersive universe inspired by the Creed™ films. Choose your path to glory in multiple games modes: store-driven Career, customizable Freeplay, or minigame-based Training.PvP just got a lot more personal. Choose your champion, then set up a custom fight with a friend or find your contenders in crossplay Quick Match. Precise upper-body tracking ensures each blow resonates where it lands—on both your opponent and yourself.','You are Adonis Creed, fighting toe-to-toe with the world’s top opponents to establish your boxing legacy. This intense cinematic experience features new Phantom Melee Technology for impactful VR melee combat so you can train, fight, and win like Creed.','0','T',1,2,'https://store.steampowered.com/app/804490/Creed_Rise_to_Glory/',1,1,'2021-06-16 16:03:18','2024-05-23 06:35:57','804490','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Creed Rise to Glory\\Creed.exe',1,1,1,0,0),(13,'Elven Assasin','elven-assasin','Take a bow and kill hordes of orcs in the epic town defense game. You can play alone to conquer the leaderboards or unite with other assassins in online co-op mode. PS. Be careful to avoid massive axes thrown at you by orc warriors.','','0','T',1,4,'https://store.steampowered.com/app/503770/Elven_Assassin/',1,1,'2021-06-16 16:10:44','2024-05-23 06:35:57','503770','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Elven Assassin\\Elven Assassin.exe',1,1,1,0,0),(14,'Loco Dojo','loco-dojo','Enter the whimsical wooden world of Loco Dojo and step up to Grand Sensei’s ‘Table of Trials’ to pit your silliest skills against (up to) three friends or strangers in this hilariously competitive cross-platform multiplayer social VR party game.','','0','E',1,4,'https://store.steampowered.com/app/667800/Loco_Dojo/',1,1,'2021-06-16 16:12:52','2024-05-23 06:35:57','667800','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Loco Dojo\\LocoDojo.exe',1,1,1,0,0),(15,'Tower Tag','tower-tag','Tower Tag is a hyper-dynamic futuristic paintball like PVP shooter with a grappling hook locomotion method that becomes second nature instantly. Without any motion sickness!...','','0','T',1,4,'https://store.steampowered.com/app/1187330/Tower_Tag/',0,1,'2021-06-16 16:15:37','2024-05-23 06:35:57','1187330','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Tower Tag\\TowerTag.exe',1,1,1,0,0),(16,'F1 2019','f1-2019','F1® 2019, the official videogame, challenges you to defeat your rivals in the most ambitious F1® game in Codemasters’ history. F1® 2019 features all the official teams, drivers and all 21 circuits from the season. This year sees the inclusion of F2™ with players able to compete in the 2018 season.','','0','E',1,1,'https://store.steampowered.com/app/928600/F1_2019/',0,1,'2021-06-16 16:36:13','2024-05-23 06:35:57','928600','C:\\Program Files (x86)\\Steam\\steamapps\\common\\F1 2019\\F1_2019.exe',1,1,0,0,0),(17,'DiRT Rally 2.0','diry-rally-2.0','DiRT Rally 2.0 dares you to carve your way through a selection of iconic rally locations from across the globe, in the most powerful off-road vehicles ever made, knowing that the smallest mistake could end your stage.','','0','E',1,1,'https://store.steampowered.com/app/690790/DiRT_Rally_20/',0,1,'2021-06-16 16:39:08','2024-05-23 06:35:57','690790','C:\\Program Files (x86)\\Steam\\steamapps\\common\\DiRT Rally 2.0\\dirtrally2.exe',1,1,0,0,0),(18,'Project CARS 2','project-cars-2','THE ULTIMATE DRIVER JOURNEY! Project CARS 2 delivers the soul of motor racing in the world’s most beautiful, authentic, and technically-advanced racing game.','','0','E',1,1,'https://store.steampowered.com/app/378860/Project_CARS_2/',0,1,'2021-06-16 16:42:36','2024-05-23 06:35:57','378860','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Project CARS 2\\pCARS2.exe',1,1,0,0,0),(19,'Spintires','spintires','Featuring a highly unique physics-based deformable terrain and water interaction technology. Spintires boasts a quirky new experience every time you play.\r\nWinch yourself, or friends out of a mudslinging exercise and explore the depths of Russia, finding garages and fuel stations to keep your vehicle alive - carry logs and bring them to the objectives without becoming lost or stuck in the mud. Unlock and use more capable vehicles, or install one of the vast amounts of attachments available to help you along the way.\r\nOffering a truly immersive driving experience, watch in amazement as your vehicle becomes entangled in trees, bogged down in mud or swept away by river currents.','','0','E',1,4,'',0,1,'2021-06-16 16:54:32','2024-05-23 06:35:57','263280','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Spintires\\Spin Tires.exe',1,1,1,0,0),(20,'TrackMania Turbo','trackmania-turbo','Trackmania offers you the ultimate arcade racing universe where everything is about reaching the perfect racing time. Test your skills in over 200 tracks, experience immediate fun by challenging your friends at home (offline splitscreen) or online.','','0','E',1,1,'https://store.steampowered.com/app/375900/Trackmania_Turbo/',0,1,'2021-06-16 16:58:52','2024-05-23 06:35:57','375900','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Trackmania Turbo\\TrackmaniaTurbo.exe',1,1,0,0,0),(21,'Eurotruck Simulator 2','eurotruck-simulator-2','Travel across Europe as king of the road, a trucker who delivers important cargo across impressive distances! With dozens of cities to explore, your endurance, skill and speed will all be pushed to their limits.','','0','E',1,1,'https://store.steampowered.com/app/227300/Euro_Truck_Simulator_2/',0,1,'2021-06-16 17:02:52','2024-05-23 06:35:57','227300','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Euro Truck Simulator 2\\bin\\win_x64\\eurotrucks2.exe',1,1,0,0,0),(22,'AFFECTED: The Manor','affected-the-manor','AFFECTED: The Manor now includes two additional gameplay modes! The Gauntlet is a speed-run mode with each player ranked on their time, and how much they screamed! Compete in global leaderboards to set the best time! DARKNESS UPDATE brings a whole new experience as you attempt to work your way through The Manor with only your candle to cast light into the darkness.','Only the brave may enter! Experience horror unlike anything you’ve known before as you try to escape The Manor. Terror lurks around every corner as you venture deeper into the abandoned house and find that the only thing keeping you alive is your sanity. Or lack thereof...','0','T',1,1,'https://store.steampowered.com/app/707580/AFFECTED_The_Manor/',1,1,'2021-06-16 17:10:05','2024-05-23 06:35:57','707580','C:\\Program Files (x86)\\Steam\\steamapps\\common\\AFFECTED - The Manor 1.55 (HTC)\\AFFECTED_The_Manor_PC.exe',1,1,0,0,0),(23,'Blade and Sorcery','blade-and-sorcery','The era of the VR weightless, wiggle-sword combat is over. Blade & Sorcery is a medieval fantasy sandbox like no other, focusing on melee, ranged and magic combat that fully utilizes a unique and realistic physics driven interaction and combat system.','','0','M',1,1,'https://store.steampowered.com/app/629730/Blade_and_Sorcery/',1,1,'2021-06-16 17:11:57','2024-05-23 06:35:57','629730','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Blade & Sorcery\\BladeAndSorcery.exe',1,1,0,0,0),(24,'BONEWORKS','boneworks','BONEWORKS Is a narrative VR action adventure using advanced experimental physics mechanics. Dynamically navigate through environments, engage in physics heavy combat, and creatively approach puzzles with physics.','BONEWORKS is an Experimental Physics VR Adventure. Use found physics weapons, tools, and objects to fight across dangerous playscapes and mysterious architecture.','0','M',1,1,'https://store.steampowered.com/app/823500/BONEWORKS/',0,1,'2021-06-16 17:13:22','2024-05-23 06:35:57','823500','C:\\Program Files (x86)\\Steam\\steamapps\\common\\BONEWORKS\\BONEWORKS\\BONEWORKS.exe',1,1,0,0,0),(25,'The Forest','the-forest','As the lone survivor of a passenger jet crash, you find yourself in a mysterious forest battling to stay alive against a society of cannibalistic mutants. Build, explore, survive in this terrifying first person survival horror simulator.','','0','',1,1,'https://store.steampowered.com/app/242760/The_Forest/',0,1,'2021-06-16 17:14:51','2024-05-23 06:35:57','242760','C:\\Program Files (x86)\\Steam\\steamapps\\common\\The Forest\\TheForest.exe',1,1,0,0,0),(26,'Half-Life Alyx','half-life-alyx','Half-Life: Alyx is Valve’s VR return to the Half-Life series. It’s the story of an impossible fight against a vicious alien race known as the Combine, set between the events of Half-Life and Half-Life 2. Playing as Alyx Vance, you are humanity’s only chance for survival.','','0','M',1,1,'https://store.steampowered.com/app/546560/HalfLife_Alyx/',1,1,'2021-06-16 17:17:44','2024-05-23 06:35:57','546560','D:\\program files\\steam library\\steamapps\\common\\Half-Life Alyx\\game\\bin\\win64\\hlvr.exe',1,1,0,0,0),(27,'Hellsplit Arena','hellsplit-arena','VR horror-slasher with physically correct combat system and dynamic battles across arenas in the dark fantasy world.','','0','M',1,1,'https://store.steampowered.com/app/1039880/Hellsplit_Arena/',0,1,'2021-06-16 17:20:27','2024-05-23 06:35:57','1039880','C:\\Program Files (x86)\\Steam\\steamapps\\common\\Hellsplit Arena\\Hellsplit_Arena.exe',1,1,0,0,0),(28,'Hot Dogs, Horseshoes & Hand Grenades','hot-dogs-horseshoes-&-hand-grenades','Do you like hot dogs? How about horseshoes? Hand grenades? (everyone likes hand grenades) Anyway, we\'ve got all that, and guns. SO MANY GUNS. So if you like ordnance, meat, and far too many groan-worthy puns, this is the VR sandbox game for you.','','0','M',1,1,'https://store.steampowered.com/app/450540/Hot_Dogs_Horseshoes__Hand_Grenades/',0,1,'2021-06-16 17:25:33','2024-05-23 06:35:57','450540','C:\\Program Files (x86)\\Steam\\steamapps\\common\\H3VR\\h3vr.exe',1,1,0,0,0),(30,'Onward','onward','Become fully immersed in the firefight! Onward is a Mil-sim multiplayer first person shooter built for vir