, EscapeVR: The Basement.','','0','T',1,1,'https://store.steampowered.com/app/566970/EscapeVR_Trapped_Above_the_Clouds/',0,1,'2021-10-15 12:59:46','2024-05-23 06:35:57','566970','',0,1,0,0,0),(111,'Outpost L5','outpost-l5','Outpost L5 is a planet defense game in virtual reality. Control a base at the Lagrange point L5, near Earth. It\'s the last surviving battle station and you are in control of its remaining ships that stand between Earth and the Armada of Invading Aliens. Tackle wave upon wave of the ever advancing enemy as they get closer and closer to the station. If they capture it, Earth is next. Hold out as long as you can. Find Power Ups, Enhanced Weapons, Shields and even Extra Ships, but they won\'t last long, so use them wisely. This classic arcade space shooter set in VR for the HTC Vive and Oculus Rift and will remind you of early 8 bit shooters. In first person virtual reality, it brings a refreshing change to the old school arcade game. Climb to the top of the Steam High Score Leader Board and Defend Earth. Or it will be.... Game Over','','0','E',1,1,'https://store.steampowered.com/app/656330/Outpost_L5/',0,1,'2021-10-15 13:13:18','2024-05-23 06:35:57','656330','',0,1,0,0,0),(112,'Monster Maze VR','monster-maze-vr','Monster Maze VR is a virtual reality maze with monsters that you can shoot. You will be teleported in spooky scenes, where you will need to find your way out of the mazes.\r\nYou will have to face your fears of height, monsters, giant spiders, snakes, death and much more.','','0','T',1,1,'https://store.steampowered.com/app/543600/Monster_Maze_VR/',0,1,'2021-10-15 13:16:51','2024-05-23 06:35:57','543600','',0,1,0,0,0),(113,'Gunheart','gunheart','Gunheart is an online co-op RPG shooter where you and your friends become customizable robotic bounty hunters trying to make a buck at the edge of the galaxy. Strafe, teleport, or boost jump anywhere and everywhere to cover kilometer long battlefields instantaneously. With teleport at your fingertips it’s easier than ever to grab the high ground and destroy the invaders.','','0','T',1,4,'https://store.steampowered.com/app/551700/Gunheart/',0,1,'2021-10-15 13:23:28','2024-05-23 06:35:57','551700','',0,1,1,0,0),(114,'TSA Frisky','tsa-frisky','You play a TSA agent managing lines, luggage, and leisure. Your goal is to clear all the passengers and their luggage without blacking out from stress. Helping you learn the ropes is your supervisor, who will point you to the tutorial slides, and let you know when you score points on the job. You will be scored based on your performance.','','0','E',1,1,'https://store.steampowered.com/app/805150/TSA_Frisky/',0,1,'2021-10-15 13:46:08','2024-05-23 06:35:57','805150','',0,1,0,0,0),(115,'Thirst VR','thirst-vr','Immerse into the post-apocalyptic world and battle enemies hell-bent on destroying you - and the water - in this infinite arcade shooter, designed exclusively for both the HTC Vive and Oculus Rift with Touch. Compete with your friends for the highest score in this easy to pick up, but hard to master VR game!','','0','T',1,1,'https://store.steampowered.com/app/510930/Thirst_VR/',0,1,'2021-10-15 13:49:30','2024-05-23 06:35:57','510930','',0,1,0,0,0),(116,'Townsmen VR','townsmen-vr','Townsmen VR uses the exciting possibilities of virtual reality to further enhance the classic city building game with entirely new gameplay experiences and interactive mechanics.\r\nThe time has come! After a complete redesign, you are no longer confined to a small island in the middle of an endless ocean. After the update, Townsmen VR gives you not only a single island to explore but a world to interact with. The game combines elements of a God-game simulation and a classic building game with the interactive possibilities of VR controls. Whether from a bird\'s eye view or zoomed in close, you will always experience the action from the right perspective.','','0','E',1,1,'https://store.steampowered.com/app/749960/Townsmen_VR/',0,1,'2021-10-15 14:00:53','2024-05-23 06:35:58','749960','',0,1,0,0,0),(118,'The Gallery - Episode 1: Call of the Starseed','the-gallery-episode-1-call-of-the-starseed','A strange message left by your mischievous twin sister, Elsie, will draw you into a mysterious journey filled with bizarre characters, a sinister presence and awe inspiring adventure. Along the way, you will be assisted by a helpful yet unhinged Professor who may harbor ulterior motives of his own. Your search for Elsie will lead you to a cosmic machine that wields incredible power and it will test your will against the forces of a shadowy figure who resides within it.','','0','T',1,1,'https://store.steampowered.com/app/270130/The_Gallery__Episode_1_Call_of_the_Starseed/',0,1,'2021-10-15 14:08:52','2024-05-23 06:35:58','270130','',0,1,0,0,0),(119,'The Gallery - Episode 2: Heart of the Emberstone','the-gallery-episode-2-heart-of-the-emberstone','After following your sister Elsie to the world of Ember, you discover the remnants of a destroyed civilization, torn apart by two siblings and their individual quests for power. Along the way you meet a mountainous ally who, like you, is looking for their other half. Using the Gauntlet, a mysterious new power capable of manipulating energy, you must unravel the history of this forgotten place, and reveal the true intentions of the dark figure who sent you here.','','0','T',1,1,'https://store.steampowered.com/app/526140/The_Gallery__Episode_2_Heart_of_the_Emberstone/',0,1,'2021-10-15 14:11:47','2024-05-23 06:35:58','526140','',0,1,0,0,0),(120,'Final Soccer VR','final-soccer-vr','For lovers of pure football!100% realistic graphics and animations made by capturing the movements of professional players.\r\nYou can choose between playing a quick game or try and defeat 150 levels where you face the best teams in the world!','','0','E',1,1,'https://store.steampowered.com/app/555060/Final_Soccer_VR/',0,1,'2021-10-15 14:36:59','2024-05-23 06:35:58','55060','',0,1,0,0,0),(121,'Apex Construct','apex-construct','Apex Construct is a story-driven, single player action/adventure made exclusively for VR. Wield an upgradable cyber bow & shield combination to battle enemy robots while exploring a shattered world, gradually realizing what led to the extinction of mankind. Also includes Cygnia Cup Challenge, a competitive game mode where you take out shooting targets and enemies in the arena to dominate the global leaderboards.','','0','T',1,1,'https://store.steampowered.com/app/694090/Apex_Construct/',0,1,'2021-10-15 14:39:43','2024-05-23 06:35:58','694090','',0,1,0,0,0),(122,'Beast Pets','beast-pets','','Beast Pets are clever and cheeky magical creatures that live in a VR sandbox world. We’re currently raising a litter of cute baby dragon pups that love to play, hang out and be fed. We\'re always adding more stuff to do so the dragons don\'t get bored. Check back often!','0','E',1,1,'https://store.steampowered.com/app/629970/Beast_Pets/',0,1,'2021-10-15 14:42:30','2024-05-23 06:35:58','629970','',0,1,0,0,0),(123,'Paranormal Activity: The Lost Soul','paranormal-activity-the-lost-soul','Armed with a battery hungry flashlight, you find yourself exploring what appears to be a quiet average looking home in a woodsy neighborhood. Before long, you discover you’re not alone as you discover the clues unraveling the horrifying mystery of what’s gone on in this house and struggle to survive the terror that hunts you.','','0','M',1,1,'https://store.steampowered.com/app/467660/Paranormal_Activity_The_Lost_Soul/',0,1,'2021-10-15 14:48:07','2024-05-23 06:35:58','467660','',0,1,0,0,0),(124,'Cloudlands: VR Mini-Golf','cloudlands-vr-mini-golf','Welcome to Cloudlands : VR Minigolf! Cloudlands is a virtual reality minigolf experience like you\'ve never experienced before. Be transported to a beautifully landscaped island archipelago above the clouds with full support for both HTC Vive and Oculus Touch. You will find no swing or power meters in Cloudlands. Cloudlands uses an intuitive 1:1 control mapping between the virtual putter and your Vive/Oculus Touch controller. Expect your real-life skills to translate into the virtual world (oh no!). Don\'t worry though. It\'s mini golf! Everyone can have fun and play.','A VR minigolf experience taking you to a beautifully landscaped course high above the clouds. Single player, online and local multiplayer, and a course editor allow you to build, share, and play other user created holes. No swing or power meters here, simply swing the club to play.','0','E',1,4,'https://store.steampowered.com/app/425720/Cloudlands__VR_Minigolf/',0,1,'2021-10-15 15:19:26','2024-05-23 06:35:58','425720','',0,1,1,0,0),(125,'Angry Birds VR: Isle of Pigs','angry-birds-vr-isle-of-pigs','Join Red, Chuck, Bomb and the Blues to save the stolen eggs in Angry Birds VR: Isle of Pigs, an immersive VR game adventure of more than 100 fun-filled levels from Resolution Games!\r\nExplore the remote island where the greedy green pigs take their vacation, slingshot your way to victory by defeating the evil Dr. Frankenswine, and create/share/discover an infinite number of levels with the online level builder.','','0','E',1,1,'https://store.steampowered.com/app/1001140/Angry_Birds_VR_Isle_of_Pigs/',1,1,'2021-10-15 15:24:21','2024-05-23 06:35:58','1001140','',0,1,0,0,0),(126,'The Walking Dead: Onslaught','the-walking-dead-onslaught','Play as Rick, Daryl, Michonne, and Carol and set up your home base in the Alexandria Safe Zone. Here, you’ll play through chapters of an all-new story, embark on Scavenger runs, upgrade your player stats, modify and customize weapons, trade in resources to grow your community, and interact with your favorite characters. Successfully complete supply runs, and you’ll see Alexandria transform as you rebuild the settlement into a fortified bastion of hope for humanity’s future.','','0','M',1,1,'https://store.steampowered.com/app/1082680/The_Walking_Dead_Onslaught/',0,1,'2021-10-15 15:32:11','2024-05-23 06:35:58','1082680','',0,1,0,0,0),(127,'Ragnarock VR','ragnarock-vr','Are you ready to rock? Ragnarock is a solo/multiplayer VR rhythm game in which you play a viking captain competing in a ship race. With your two hammers, crush the incoming runes in sync with epic viking music. Keep hitting the runes perfectly to accumulate combo energy in your hammers, and you will be able to activate a speed boost!','','0','E',1,1,'https://store.steampowered.com/app/1345820/Ragnarock/',1,1,'2021-10-15 15:42:26','2024-05-23 06:35:58','1345820','',0,1,0,0,0),(128,'FIVE NIGHTS AT FREDDY\'S: HELP WANTED','five-nights-at-freddys-help-wanted','Five Nights at Freddy’s: Help Wanted is a collection of classic and original mini-games set in the Five Nights universe. Experience the horror in flat (non-VR) mode or VR. Oculus Rift and HTC Vive are supported. A VR Headset is NOT required to play.','','0','T',1,1,'https://store.steampowered.com/app/732690/FIVE_NIGHTS_AT_FREDDYS_HELP_WANTED/',1,1,'2021-10-15 16:54:21','2024-05-23 06:35:58','732690','',0,1,0,0,0),(129,'Nefertari: Journey To Eternity','nefertari-journey-to-eternity','For the first time ever, step inside Nefertari\'s tomb and immerse yourself in the story of its art, history, construction, and mythology through interactive elements.','','0','E',1,1,'https://store.steampowered.com/app/861400/Nefertari_Journey_to_Eternity/',0,1,'2021-10-15 17:00:43','2024-05-23 06:35:58','861400','',0,1,0,0,0),(130,'RollerCoaster Legends','rollercoaster-legends','Transport yourself to the land of Greek mythology on a virtual reality RollerCoaster ride you\'ll never forget. Unlike any VR rollercoaster experience you have seen.','','0','T',1,1,'https://store.steampowered.com/app/756040/RollerCoaster_Legends/',0,1,'2021-10-15 17:04:15','2024-05-23 06:35:58','756040','',0,1,0,0,0),(131,'RollerCoaster Legends II: Thor\'s Hammer','rollercoaster-legends-ii-thors-hammer','Experience Norse mythology in an unbelievable seven minute non-stop rollercoaster ride made for virtual reality. Meet giants, elves, trolls and a fire-breathing dragon while riding the coaster of a lifetime.','','0','T',1,1,'https://store.steampowered.com/app/854690/RollerCoaster_Legends_II_Thors_Hammer/',0,1,'2021-10-15 17:17:38','2024-05-23 06:35:58','854690','',0,1,0,0,0),(132,'Short Circuit VR','short-circuit-vr','Short Circuit VR is an electronics lab simulator in Virtual Reality. You can build your own electronic circuits with the components provided, learn basic electronics by completing challenges and just have fun while experimenting and making awesome projects!','','0','E',1,1,'https://store.steampowered.com/app/970800/Short_Circuit_VR/',0,1,'2021-10-15 17:23:39','2024-05-23 06:35:58','970800','',0,1,0,0,0),(133,'Spiderman: Far from Home Virtual Reality','spiderman-far-from-home-virtual-reality','Based on the film, the Spider-Man: Far From Home VR Experience is a fast-swinging, thrill ride through the eyes of your favorite neighborhood Spider-Man. Spider-Man: Far From Home – now available on disc and digital.','','0','E',1,1,'https://store.steampowered.com/app/1067800/SpiderMan_Far_From_Home_Virtual_Reality/',0,1,'2021-10-15 17:25:48','2024-05-23 06:35:58','1067800','',0,1,0,0,0),(134,'Surgeon Simulator VR: Meet the Medic','surgeon-simulator-vr-meet-the-medic','Surgeon Simulator VR: Meet the Medic – be the Medic and operate on the Heavy in this free and exclusive teaser for the HTC Vive!','','0','T',1,1,'https://store.steampowered.com/app/457420/Surgeon_Simulator_VR_Meet_The_Medic/',0,1,'2021-10-15 17:42:49','2024-05-23 06:35:58','457420','',0,1,0,0,0),(135,'The Lab','the-lab','Welcome to The Lab, a compilation of Valve’s room-scale VR experiments set in a pocket universe within Aperture Science. Fix a robot, defend a castle, adopt a mechanical dog, and more. Still not sold? It’s free!','','0','E',1,1,'https://store.steampowered.com/app/450390/The_Lab/',0,1,'2021-10-15 17:45:23','2024-05-23 06:35:58','450390','',0,1,0,0,0),(136,'Tilt Brush','tilt-brush','Tilt Brush lets you paint in 3D space with virtual reality. Unleash your creativity with three-dimensional brush strokes, stars, light, and even fire. Your room is your canvas. Your palette is your imagination. The possibilities are endless.','','0','E',1,1,'https://store.steampowered.com/app/327140/Tilt_Brush/',0,1,'2021-10-15 17:47:17','2024-05-23 06:35:58','327140','',0,1,0,0,0),(137,'Titanic VR','titanic-vr','Witness the sinking of RMS Titanic. Explore the shipwreck. Titanic VR is a diving simulator and immersive interactive story. With over 6 hours of game-play Titanic VR you will leave with a greater understanding of the historic tragedy that unfolded in 1912.','','0','T',1,1,'https://store.steampowered.com/app/741430/Titanic_VR/',0,1,'2021-10-15 18:30:05','2024-05-23 06:35:58','741430','',0,1,0,0,0),(138,'Titans of Space PLUS','titans-of-space-plus','Just how big is big? Journey through this holographic Solar System, and then squint your eyes in the intense light of a few of the largest known stars. Enjoy various accidentally-educational activities along the way. Great care has been taken to ensure a comfortable VR experience. VR optional.','','0','E',1,1,'https://store.steampowered.com/app/468820/Titans_of_Space_PLUS/',0,1,'2021-10-15 18:32:01','2024-05-23 06:35:58','468820','',0,1,0,0,0),(139,'Ultrawings','ultrawings','Ultrawings is an aerial-themed, open-world flight game where you use your virtual hands to fly multiple aircraft to complete a variety of missions across a beautiful, island-themed world!','','0','E',1,1,'https://store.steampowered.com/app/639130/Ultrawings/',0,1,'2021-10-15 18:33:57','2024-05-23 06:35:58','639130','',0,1,0,0,0),(140,'Virtual Virtual Reality','virtual-virtual-reality','A game about VR, AI, and our collective sci-fi fever dreams. In a future where AI has transformed society, can humans still find purpose? Find out with Activitude, a service that lets humans aid AI clients in increasingly curious ways.','','0','T',1,1,'https://store.steampowered.com/app/889480/Virtual_Virtual_Reality/',0,1,'2021-10-15 18:35:37','2024-05-23 06:35:58','889480','',0,1,0,0,0),(141,'A Fisherman\'s Tale','a-fishermans-tale','Playing as Bob, a tiny fisherman puppet, you live alone in your tiny cabin, oblivious to the world outside. When your radio broadcasts a storm alert, you have to get to the top of the lighthouse and turn on the light! But as you try to leave your cabin with the help of some uncanny sidekicks, you realize what\'s waiting outside is not at all what you expected...','Bend and twist reality in A Fisherman\'s Tale, the mind-bending VR puzzle adventure game in which being turned upside down and inside out is not merely a play on words.','0','T',1,1,'https://store.steampowered.com/app/559330/A_Fishermans_Tale/',0,1,'2021-10-15 18:43:22','2024-05-23 06:35:58','559330','',0,1,0,0,0),(142,'10k','10k','Make worlds of your own using real data along with free 3D models. 10k lets you create entirely in-world in VR, using open data sources - from 3D models and images to financial datasets to molecular structures.','Explore and build VR worlds using scientific and other data, along with free 3D models. 10k lets you create entirely in-world, using open data sources - from 3D models and images to financial datasets to molecular structures.','0','E',1,1,'https://store.steampowered.com/app/879660/10k/',0,1,'2021-10-22 15:19:22','2024-05-23 06:35:58','879660','',0,1,0,0,0),(143,'1976 Back to Midway','1976-back-to-midway','It’s the year 1976. We’re in a dystopian reality in which the Nazi army ended up defeating the Allied Front and winning the Great War. In this apocalyptic parallel universe, Hitler has declared himself Supreme World Chancellor and, what’s even more terrifying, Tyrolean pants are all the rage across the globe. However, there’s still hope. Despite the scarcity of resources, the Allied resistance’s brightest scientists, led by the eccentric Dr. Ivan Ivanovich, have made the impossible possible: they’ve built a time machine.','Are you ready to travel back in time to 1943 and relive the excitement of classic arcade dogfights? Now, thanks to Virtual Reality, you’re about to discover a new level of immersion and spectacularity, while retaining the original essence and fun.','0','T',1,1,'https://store.steampowered.com/app/1118070/1976__Back_to_midway/',0,1,'2021-10-22 15:32:02','2024-05-23 06:35:58','1118070','',0,1,0,0,0),(144,'A Lost Room','a-lost-room','Have you ever played an escape game? That amazing scenario, complex puzzles, where you must pay attention to everything, everywhere, find crazy items in bizarre places, and finally, open that door to victory.\r\nWhat about real-life escape games? Some physical place, where you spend one entire hour inside, looking for clues and yelling at your friends for no reason, until those final seconds, where it all ends and you escape! Or someone comes in and says you’ve failed miserably.','A Lost Room is an escape game without the boundaries of real world, powered by VR. In a place where anything can happen, what will you do to escape this huge complex alive?','0','T',1,1,'https://store.steampowered.com/app/613040/A_Lost_Room/',0,1,'2021-10-22 15:37:03','2024-05-23 06:35:58','613040','',0,1,0,0,0),(145,'A Lullaby Of Colors','a-lullaby-of-colors','Feeling stressed? Treat yourself to this therapeutic VR refuge from the real world with procedurally generated realms of gentle sounds, sweet-tasting colors, and breathtaking beauty. Find and catch the bouncing spheres to visit different worlds. Find the perfect place to relax and watch the virtual world go by. There are no enemies, quests, guns, or puzzles. There is no objective other than to relax and enjoy.','Blissful psychedelic relaxation experience for VR. Fly through breathtakingly beautiful worlds of endless sweet-tasting colors and gentle sounds. Great for relaxing, open-eyed meditation, or jaw-dropping drug-free tripping.','0','E',1,1,'https://store.steampowered.com/app/992960/A_Lullaby_of_Colors_VR/',0,1,'2021-10-22 15:39:23','2024-05-23 06:35:58','992960','',0,1,0,0,0),(146,'A Ton Of Feathers','a-ton-of-feathers','A ton of feathers is a VR game that pushes the experiential boundaries of VR to the absolute limit. You play as a writer in a future dystopian City asked to hunt down a serial killer by exploring The criminals books and writings, you are transported in to bizarre Worlds where you will meet Kings, robots, sentient teddy bears and more. The games genre hops from comedic to psychological horror With an overarching story that blends the narrative together in a hallucinogenic Robotik Joyride.','Hunt for the truth in the most intense VR game ever made','0','T',1,1,'https://store.steampowered.com/app/1233820/A_Ton_Of_Feathers/',0,1,'2021-10-22 15:43:25','2024-05-23 06:35:58','1233820','',0,1,0,0,0),(147,'A Very Bad Christmas Eve','a-very-bad-christmas-eve','It is Christmas Eve. Santa Claus has just flown off with his sleigh, leaving the most magical workshop in the world. Not so long after he left, all of the elves went straight home and tucked in for the night. Except you. You play as the last Elf who still hasn’t left Santa’s workshop. Imagine yourself on a rocking chair in front of a burning fireplace, completely undisturbed, finishing the last sips of a rich hot chocolate. The lights are dimmed, Christmas lights are twinkling, you are enjoying the sounds of wood crackling in the fireplace. You can hear your favourite Christmas tracks playing from a distant old radio. Then, all of a sudden, an alarm starts to ring. You jump out of the chair and see that one of Santa’s machines has broken down. Then you realise that you are the only elf who can save Christmas. But can old St.Nick really count on you?','Could you save Christmas if you are the only Elf Santa Claus can count on? Challenge yourself in the single-player action-adventure puzzle game A Very Bad Christmas Eve tailor-made for the VR platform.','0','T',1,1,'https://store.steampowered.com/app/1480650/A_Very_Bad_Christmas_Eve/',0,1,'2021-10-22 15:47:04','2024-05-23 06:35:58','1480650','',0,1,0,0,0),(148,'A-10 VR','a-10-vr','A-10 VR combines stunning graphics with simplistic gameplay to introduce players of all ages and skill to the possibilities of virtual reality. A-10 VR has been geared towards users trying VR for the first time, although sharp shooters will be able to spend hours mastering their gun play. Fit with both global and local leaderboards.','A-10 VR is a fresh virtual reality take on a classic sci-fi gallery shooter. Hone your sharp shooting skills in 4 game modes against a stunning outer space landscape in this arcade shooter meant for all skill levels! Fit with both global and local leaderboards.','0','E',1,1,'https://store.steampowered.com/app/436220/A10_VR/',0,1,'2021-10-22 15:49:29','2024-05-23 06:35:58','436220','',0,1,0,0,0),(149,'A-Tech Cybernetic','a-tech-cybernetic','A-Tech Cybernetic is a first-person shooter built from the ground up for VR. It features two separate game modes: a classic swarm mode to put your shooting and survival skills to the test and a story mode that takes you to a futuristic biomedical company overrun by mutants. Control everything with real-life movements, interact with your surroundings as if they were actually there, experience a new kind of gameplay that’s more immersive than ever before, thanks to VR. Be the badass guy you always wanted to be.','Built exclusively for VR, A-Tech Cybernetic\'s Story Mode will offer hours of explosive fun, while Swarm Mode will test your grit in a sci-fi nightmare scenario. Stop the mutant invasion at a futuristic megacorp, controlling an arsenal of weapons with real life movements!','0','M',1,1,'https://store.steampowered.com/app/578210/ATech_Cybernetic_VR/',0,1,'2021-10-22 16:03:13','2024-05-23 06:35:58','578210','',0,1,0,0,0),(150,'ABC Paint','abc-paint','ABC Paint is a simple Multiplayer VR drawing experience that anyone can start using in seconds. Randomized funny heads for players. Draw on your friends\' head or paint them a stick figure body. The non-violent nature and ease of use makes the game suitable for even the youngest of players as their first step into VR.','A VR drawing app as easy as ABC. No clever hologram-menus or impressive lazer-pointer interactions - just You, the brush, palette and an endless canvas. Suitable for any age.','0','E',1,4,'https://store.steampowered.com/app/907520/ABC_Paint/',0,1,'2021-10-22 16:09:27','2024-05-23 06:35:58','907520','',0,1,1,0,0),(151,'(Earth and Space) Adventures in Space','earth-and-space-adventures-in-space','The learning adventures in this science curriculum unit include the opportunity to pilot a spaceship, as well as a Mars Rover while learning some of the most important lessons about the Universe. Along the way, you will meet Wendy, the Science Teacher, who presents lessons at a high school level in a fun and impactful way. You will also meet Steve, the virtual field trip host, who teaches about the solar eclipse in real time as it occurs above you. Even more, you will drive a Rover over the surface of Mars and visit replicas of the actual U.S. Rovers intentionally left there.','','0','E',1,1,'https://store.steampowered.com/app/1208160/Adventures_in_Space/',0,1,'2021-10-22 16:14:01','2024-05-23 18:34:43','1208160','',0,1,0,0,0),(152,'(Earth and Space) Ancient Adventures','earth-and-space-ancient-adventures','Wendy the science teacher takes us - in full 360 virtual reality - to Craters of the Moon in Idaho, to understand how craters impacted the world around us. And take a dune buggy ride with Steve, your VictoryVR host, through Silver Lake Sand Dunes. It’s a wild ride as you fly over the sand dunes and see how sand on the East coast of Lake Michigan is overtaking homes. The stories take you back to the beginning of the universe as it explodes into life and follow earth’s formation from the age of volcanoes to the modern era. As always, VictoryVR is fun and amazing, but students learn science while they are immersed inside it. Each unit is tied to Next Gen Science Standards which are the national standards that 19 states have adopted while another 20 are considering.','Step into the time machine and travel back in time millions and billions of years ago to experience the earth as it looked during its earliest years. Don’t be afraid of the dinosaurs...they’re mostly friendly.','0','E',1,1,'https://springboardvr.com/marketplace/ancientadventures',0,1,'2021-10-22 16:17:12','2024-05-23 06:35:58','','',0,1,0,0,0),(153,'Abode','abode','Be a vigilant detective! Explore and investigate every corner and detail of the worn down apartment. Find objects or items to inspect, search through boxes, drawers and furniture. Repair broken equipment or utilize items and furniture in the room in order to unveil all it\'s secrets.','Abode is an escape room puzzle game. You will have to find, combine and utilize tools and furniture in the room to unveil all its secrets.','0','T',1,1,'https://store.steampowered.com/app/548340/Abode/',0,1,'2021-10-22 16:19:04','2024-05-23 06:35:58','548340','',0,1,0,0,0),(154,'Acron: Attack of the Squirrels!','acron-attack-of-the-squirrels','The golden acorns are under attack! It’s up to you and your friends to protect them or steal them - depending if you take on the role of an extraordinarily protective tree or as one of several crafty yet thieving squirrels - in the hit cross-platform party game, Acron: Attack of the Squirrels!, from Resolution Games. A game that’s at its best when played as a couch party game with a group of friends, Acron: Attack of the Squirrels! is both competitive and cooperative in nature and brings together players across VR and mobile devices.','Do you have what it takes to protect the golden acorns in this nutty multiplayer party game, or are you feeling a little squirrely?','0','E',1,4,'https://store.steampowered.com/app/1094870/Acron_Attack_of_the_Squirrels/',0,1,'2021-10-22 16:22:30','2024-05-23 06:35:58','1094870','',0,1,1,0,0),(155,'Aery: Little Bird Adventure','aery-little-bird-adventure','Aery is a peaceful exploration game from the perspective of a little bird who decided to discover the world. Calm down from the hassle of your daily life, experience the feeling of flying, and immerse yourself into beautiful and atmospheric landscapes. It is a great game for relaxing and calming down after an exhausting day full of hassle.','Aery is a peaceful exploration game from the perspective of a little bird who decided to discover the world. Calm down from the hassle of your daily life, experience the feeling of flying, and immerse yourself into beautiful and atmospheric landscapes.','0','E',1,1,'https://store.steampowered.com/app/1424770/Aery__Little_Bird_Adventure/',0,1,'2021-10-22 16:25:03','2024-05-23 06:35:58','1424770','',0,1,0,0,0),(156,'AFTER - H','after-h','Mars, 2080. Two human factions are fighting over key strategic points in the Solar System. Join the Martian battlefields and fight as the Alliance or the Rebels in a competitive fast-paced FPS. Gather your crew in Team Deathmatch mode to overtake a space ship crash site on Mars. Play solo against other players in a FFA match or take control of ancient artifacts playing Domination mode!','Join the Martian battlefields and fight as the Alliance or the Rebels in a competitive fast-paced FPS.','0','T',1,4,'https://store.steampowered.com/app/854110/AFTERH/',0,1,'2021-10-22 16:27:39','2024-05-23 06:35:58','854110','',0,1,1,0,0),(157,'Afterlife','afterlife','Play as Adam Bernhard, a young rookie police officer on a routine night patrol, who receives a call that will change his life forever. What is really lurking behind the door of a well-known mental facility, where Adam’s younger sister, Allison, was recently sent? Is there any connection between missing patients and hospital workers and the groundbreaking study about the Indigo Children phenomena? Uncover the secrets hidden deep within the Black Rose mental hospital walls, where most of the patients pose a threat to themselves and to others. Look into the eyes of pure madness intrinsically linked with this place and its history.','Afterlife VR is a deeply immersive horror game. As Adam Bernhard, a young rookie police officer on a night patrol, you receive a call that will change your life forever. Uncover secrets hidden deep within the Black Rose mental hospital walls, where most of the patients pose a great danger.','0','M',1,1,'https://store.steampowered.com/app/1528020/Afterlife_VR/',0,1,'2021-10-22 16:30:10','2024-05-23 06:35:58','1528020','',0,1,0,0,0),(158,'Anti Air','anti-air','As the Cubicon Conjunction begins, descent to various planets across the galaxy and blast away the Cubicon invaders. For the Cubicons it is not just a matter of cubes, it is about life and death. Use a variety of advanced weaponry to battle these Alien invaders. Resist waves of different Cubicon invaders which enter the planet’s troposphere from the outer space. Their goal is to eradicate everything on the planet, starting with you – the planet’s first line of defense and its last chance.','Are you the new recruit? Well, grab your weapons and descent into battle on distant planets. There you will combat the Alien invasion called the Cubicon Conjunction. Waves will hit you so you better blast these invaders from the sky before they crash onto your base. How many will you take down?','0','T',1,1,'https://store.steampowered.com/app/1237670/Anti_Air/',0,1,'2021-10-22 16:32:47','2024-05-23 06:35:58','1237670','',0,1,0,0,0),(159,'Arcade Artist','arcade-artist','The team behind the Arcade Artist wanted to create a world that allows you to step into a fantastical place where you can IMAGINE, CREATE ART and CAUSE CHAOS. With simple and intuitive tools, like the Laser Light Etcher, Velocity Brush, and Paintball Blaster Prototype #7, you can get lost. Players will be surprised and delighted on how much fun VR can be. Especially when they unlock hidden surprises within the world.','Arcade Artist is an experience that combines the unique exploration of a creative playground along with casual arcade activities that makes this VR experience perfect for all age groups.','0','E',1,1,'https://store.steampowered.com/app/534430/Arcade_Artist/',0,1,'2021-10-28 14:59:35','2024-05-23 06:35:58','534430','',0,1,0,0,0),(160,'LA Deadzone','la-deadzone','An unknown virus rapidly spread through Los Angeles. The infection left thousands of undead roaming the streets. The west coast has collapsed with only a few people remaining. All hope of making it out alive was lost until hearing a radio message from a resistance group. To survive the group must work together and make it through the fallen city.','LA Deadzone is an arcade exclusive Free Roam Experience. Players will physically walk through the environment to naturally progress through the story with no artificial locomotion. The Players experience an intense survival adventure fighting off zombies as they try to escape','0','M',1,4,'https://store.steampowered.com/app/926220/LA_Deadzone/',0,1,'2021-10-28 15:02:58','2024-05-23 06:35:58','926220','',0,1,1,0,0),(161,'Archery Kings VR','archery-kings-vr','Archery is the sport, practice or skill of using a bow to propel arrows. The word comes from the Latin arcus. Historically, archery has been used for hunting and combat. In modern times, it is mainly a competitive sport and recreational activity.','Experience the feeling of archery in your home! Archery Kings is a VR-sport game which you can experience a life-like archery play in virtual reality applied realistic physical arrow movement.','0','E',1,2,'https://store.steampowered.com/app/802340/Archery_Kings_VR/',0,1,'2021-10-28 15:06:48','2024-05-23 06:35:58','802340','',0,1,1,0,0),(162,'Arrowborn','arrowborn','Arrowborn brings you the fast-paced and visceral action of a multiplayer first-person shooter and combines it with the immersive experience of virtual reality archery. Show your lethal accuracy and clever map tactics as you load your quiver full of deadly magical arrows and lay waste to the competition!','Arrowborn is multiplayer Player versus Player VR Archery. Load your quiver with deadly magical arrows, ready your shield, then leap through the air as you loose barrages on your enemies from all angles.','0','T',1,10,'https://store.steampowered.com/app/833070/Arrowborn/',0,1,'2021-10-28 15:09:50','2024-05-23 06:35:58','833070','',0,1,1,0,0),(163,'Art Plunge','art-plunge','Art Plunge is a gallery where you can get the feeling of being inside famous paintings. This is not a game. This is a short but sweet experience featuring VR interpretations of the following five artworks:\r\n* Mona Lisa\r\n* Starry Night\r\n* The Birth of Venus\r\n* The Creation of Adam\r\n* Girl Reading a Letter at an Open Window','Get the feeling of being inside famous paintings!','0','E',1,1,'https://store.steampowered.com/app/570900/Art_Plunge/',0,1,'2021-10-28 15:11:34','2024-05-23 06:35:58','570900','',0,1,0,0,0),(164,'ArtPulse','artpulse','ArtPulse offers an artistic VR sandbox to play and express your creativity in. Spawn and combine shapes, colors, and freehand painting to sync them seamlessly into the background music. You don’t need to be an experienced artist or musician to make cool stuff, but you can just create and let the game elevate it!','Spawn and combine shapes, colors and freehand painting to sync them seamlessly into the background music. Let your creativity flow free!','0','E',1,1,'https://store.steampowered.com/app/1229190/ArtPulse/',0,1,'2021-10-28 15:13:38','2024-05-23 06:35:58','1229190','',0,1,0,0,0),(165,'Ashi Wash','ashi-wash','It is said that long ago in Japan, there was a certain house. Every so often, a strange thing happened in this place: a yokai in the shape of a giant dirty foot appeared and demanded to be cleaned! If the resident cleaned the foot, the foot left peacefully. However, if the foot was not cleaned, then the foot stomped throughout the house and destroyed everything.','Clean a big nasty foot!','0','E',1,1,'https://store.steampowered.com/app/820210/Ashi_Wash/',0,1,'2021-10-28 15:15:41','2024-05-23 06:35:58','820210','',0,1,0,0,0),(166,'Audio Trip','audio-trip','Dance to the rhythm and immerse yourself into the world of Audio Trip! Catch gems, ride ribbons, smash drums, and dodge barriers as you move your body! With 84 levels across 21 songs, plus support for custom songs. Express yourself through movement and unleash the inner dancer/fitness fanatic in you!','Audio Trip aims to be the definitive VR dance game, featuring music from your favorite artists: Lady Gaga, Skrillex, Zedd, deadmau5, Tiësto, and more! Catch gems, ride ribbons, dodge barriers, and smash drums on YOUR Audio Trip!','0','E',1,1,'https://store.steampowered.com/app/826540/Audio_Trip/',0,1,'2021-10-28 15:17:37','2024-05-23 06:35:58','826540','',0,1,0,0,0),(167,'Awake: Episode One','awake-episode-one','Enter the world of AWAKE, a ground-breaking first-person cinematic VR thriller, that blurs the line between memories, dreams and reality. In Episode One, you are a new presence in the story of Harry; a man obsessed with solving a mysterious lucid dream. It’s an obsession that has also cost Harry dearly and now he is stuck, waiting for release. You are the witness and it’s time for Harry to wake up! As the ever deepening layers of Harry’s story are revealed a sinister force could lead to Harry breaking one last time. AWAKE presents a rich new genre of immersive cinema, for you to discover.','AWAKE is an unforgettable, thought-provoking experience; seamlessly blending complex environments with photo realistic volumetric video to create a new benchmark in immersive cinema. You are a new presence in the story of Harry; a man obsessed with solving a mysterious lucid dream.','0','T',1,1,'https://store.steampowered.com/app/845900/Awake_Episode_One/',0,1,'2021-10-28 15:27:26','2024-05-23 06:35:58','845900','',0,1,0,0,0),(168,'Awaken','awaken','Set in beautiful worlds and designed solely for VR, Awaken is a captivating puzzle game and rhythmic music experience from Blueprint Reality Inc. coming to the HTC Vive and Oculus Rift in Q1 2017! You are a new beginning. You must awaken the universe, for it has too long been shrouded in darkness. You must use your powers to guide the light. As you harness the energy, you will awaken the Guardians. Together you can push back the darkness and once again bathe the universe in light. And then life.','Set in beautiful worlds and designed solely for VR, Awaken is a captivating puzzle game and rhythmic music experience. Become an architect of light, awaken the universe and bring back the stars. Awaken features both a campaign mode and a level creation mode to build puzzles and challenge friends.','0','T',1,1,'https://store.steampowered.com/app/555970/Awaken/',0,1,'2021-10-28 15:31:19','2024-05-23 06:35:58','555970','',0,1,0,0,0),(169,'BAAM SQUAD','baam-squad','BAAM SQUAD is a VR zombie co-op shooter following a band of four brave agents seeking to shoot, loot and run in order to solve the mystery case of Santana\'s Sweets Factory: The place where it’s been taken over by zombies eating human flesh and candies. Select your hero, team up with other players, and navigate through infinite waves of zombies. Scout the locale and smash the undeads to protect yourself, using a diverse selection of weapons ranging from classic pistol to leading-edge laser gun.','BAAM SQUAD is a VR zombie co-op shooter following a band of four brave agents seeking to shoot, loot and run in order to solve the mystery case of Santana\'s Sweets Factory: The place where it’s been taken over by zombies eating human flesh and candies!','0','T',1,4,'https://store.steampowered.com/app/736720/BAAM_SQUAD/',0,1,'2021-10-28 15:34:01','2024-05-23 06:35:58','736720','',0,1,1,0,0),(170,'BAD BILLY 2D VR','bad-billy-2d-vr','','Billy is really angry! Billy\'s girlfriend Jessica was kidnapped by creatures from a 2D World. Billy has to follow the creatures into the 2D World to free Jessica.','0','E',1,1,'https://store.steampowered.com/app/1026210/BAD_BILLY_2D_VR/',0,1,'2021-10-28 15:36:25','2024-05-23 06:35:58','1026210','',0,1,0,0,0),(171,'Baseball Kings VR','baseball-kings-vr','Baseball Kings VR is aimed at realistic Baseball games using virtual reality systems. If you want to enjoy sports through VR, Baseball kings VR will be a choice without regret! By application of physics, you can hit to precise directions make it possible of follow, pulling and bunt.','Experience the feeling of Baseball Slugger in your home! Baseball Kings is a VR-sport game which you can experience a life-like Baseball hitting play in virtual reality applied realistic physical ball movement and spinning.','0','E',1,1,'https://store.steampowered.com/app/802300/Baseball_Kings_VR/',0,1,'2021-10-28 15:39:19','2024-05-23 06:35:58','802300','',0,1,0,0,0),(172,'Battle Dome','battle-dome','Battle Dome is a 5 v 5 competitive SciFi VR shooter (There is a mouse and keyboard mode, but VR is recommended). You must work with your teammates to get to your opponent\'s base and destroy their core before they destroy yours. You must also spread your team\'s color (if playing a color map), since you can only teleport onto your teams colored tiles. Battle Dome also features trackpad locomotion, which can be used to any non-color map.','Have a virtual shootout with other players! Work by yourself or with teammates to achieve victory. Will you survive the Battle Dome?','0','T',1,5,'https://store.steampowered.com/app/484870/Battle_Dome/',0,1,'2021-10-28 15:41:03','2024-05-23 06:35:58','484870','',0,1,1,0,0),(173,'Battle Of Kings VR','battle-of-kings-vr','Battle of Kings is a tower defense strategy game in which you take the command and use your strategic skills to defend the siege against your fortifications. You can’t win only by defending your Kingdom. Develop your economics, assemble and upgrade your army to defeat the enemy forces in a real Battle of Kings.','The time of war has come! Take the command of your kingdom and use your strategic skills to defend the siege against your fortifications. You can’t win only by defending your Kingdom. Develop your economics, assemble and upgrade your army to defeat the enemy forces in a real Battle of Kings.','0','E',1,1,'https://store.steampowered.com/app/778250/Battle_of_Kings_VR/',0,1,'2021-10-28 15:43:42','2024-05-23 06:35:58','778250','',0,1,0,0,0),(174,'BattleSky VR','battlesky-vr','BattleSky VR is a Multiplayer VR shooter game, bringing Overwatch style gameplay to the VR platform. Each player picks a Hero with vastly different size, powers and gameplay style to engage in fast-paced aerial combats against other players. Play online against other players with classic Team Deathmatch, Team Escort, Free For All, Attack and Defend, and other team based modes of up to 4v4 players! Pick your Heroes wisely, your unique powers will determine gameplay strategies as you team up to defeat the opponents!','BattleSky VR is a Multiplayer VR flying first-person shooter, bringing Overwatch style gameplay to the VR platform. Each player picks a Hero with vastly different size, powers and gameplay style to engage in fast-paced aerial combats against other players.','0','T',1,4,'https://store.steampowered.com/app/625830/BattleSky_VR/',0,1,'2021-10-28 15:45:54','2024-05-23 06:35:58','625830','',0,1,1,0,0),(175,'Battlewake Arcade','battlewake-arcade','Avast, matey! Rough seas await in Battlewake, a fantasy naval combat game built for VR from the creators of Raw Data and CREED: Rise to Glory. Play as 4 mythical pirate lords, captain massive battle-ready warships, and summon ancient powers as you set sail on a larger-than-life nautical war for the ages.','Fight for dominion in Battlewake, a fantasy naval combat game built for VR. Play as 4 mythical pirate lords, captain massive battle-ready warships, and summon ancient powers as you set sail on a larger-than-life nautical war for the ages.','0','E',1,1,'https://store.steampowered.com/app/814400/Battlewake/',0,1,'2021-10-28 15:48:55','2024-05-23 06:35:58','814400','',0,1,0,0,0),(176,'Beat Blaster','beat-blaster','Beat Blaster is a VR game about Shooting & running where everything happens to the beat of the music. An original mix of styles with each level offering a new challenge.','Beat Blaster is a VR game in which the player must master the art of shooting, running and dodging obstacles and enemies. An original mix of styles with each level offering a new challenge.','0','T',1,1,'https://store.steampowered.com/app/1020390/Beat_Blaster/',0,1,'2021-10-28 15:51:14','2024-05-23 06:35:58','1020390','',0,1,0,0,0),(177,'Beat Blocks','beat-blocks','Beat Blocks VR is a VR arcade puzzle game in which you have to assemble the blocks and find the best possible combinations to make them disappear. Your goal is simple: beat the high-score and become the best player in the world. Beat Blocks VR offers you an infinite experience, each one of your game is unique. You create your own game with your combinations.','Beat Blocks VR is a VR Arcade Puzzle game where your goal is to assemble blocks and make best combinations to be the best player in the world. Very innovative game, you will interact directly with shapes linked to the level soundtrack.','0','E',1,1,'https://store.steampowered.com/app/966590/Beat_Blocks_VR/',0,1,'2021-10-28 15:53:23','2024-05-23 06:35:58','966590','',0,1,0,0,0),(178,'Becoming Homeless: A Human Experiment','becoming-homeless-a-human-experiment','Researchers from Stanford have run thousands of participants through this experience in an effort to study the effect of VR experiences on empathy. Across our studies, we demonstrate that a VR experience changes helping behavior more than other types of perspective taking exercises, and the effect lasts months afterward. While this 7-minute journey does not come close to immense burden of living without a home, researchers continue to find that VR experiences can be a powerful tool to help put oneself in the shoes of another.','In this immersive virtual reality experience from Stanford University’s Virtual Human Interaction Lab, spend days in the life of someone who can no longer afford a home. Interact with your environment to attempt to save your home and to protect yourself and your belongings as you walk in another’s shoes and face the adversity of living with diminishing resources.','0','T',1,1,'https://store.steampowered.com/app/738100/Becoming_Homeless_A_Human_Experience/',0,1,'2021-10-28 15:56:14','2024-05-23 06:35:58','738100','',0,1,0,0,0),(179,'Big Breezy Boat','big-breezy-boat','Be free and go sailing on your own yacht surrounded by relaxing ocean! You can steer, control the sails and teleport around the boat. Meet others sailors in an optional multiplayer mode.','Be free and go sailing on your own yacht surrounded by relaxing ocean!','0','E',1,4,'https://store.steampowered.com/app/958790/Big_Breezy_Boat__Relaxing_Sailing/',0,1,'2021-10-28 15:58:50','2024-05-23 06:35:58','958790','',0,1,1,0,0),(180,'Big Cat Rescue VR','big-cat-rescue-vr','Did you know the tiger could go extinct in the wild, in YOUR lifetime? It\'s not too late to save them! Become a wildcat tracker assistant and learn how to find and protect tigers in the wild. Assist in the search of a missing tiger through a guided forest experience with a Big Cat Rescue tracker named Jamie. Learn about the different ways to spot a tiger by looking for paw prints, scrape marks on trees, cat scat and the sounds of their prey.','Big Cat Rescue VR offers a first-person view into the world of big cats. Starting with tigers, our goals is to offer a live, up close and personal encounter with these formidable felines.','0','E',1,1,'https://store.steampowered.com/app/1463380/Big_Cat_Rescue_VR/',0,1,'2021-10-28 16:00:34','2024-05-23 06:35:58','1463380','',0,1,0,0,0),(181,'Black Hat Cooperative','black-hat-cooperative','“Listen carefully to my directions. Look to your right. There are two agents behind that door and they will reach you in 5 seconds. They just heard you. RUN!” Black Hat Cooperative is an award-winning stealth game that pits you and an ally against robot agents that seek to remove you from the system. Explore complex levels filled with hidden dangers and work together to survive.','','0','T',1,4,'https://store.steampowered.com/app/503100/Black_Hat_Cooperative/',0,1,'2021-10-28 16:03:09','2024-05-23 06:35:58','503100','',0,1,1,0,0),(182,'Blasters of the Universe','blasters-of-the-universe','You\'ll need to physically duck, dodge, twist, and turn your way through hundreds of bullets. We scale the action dynamically to make use of the space you have available, so the more you move around the better! Like in a traditional bullet hell game, the key to success is finding the \'sweet spot\' to be in while the onslaught of bullets flies toward you. The only thing that can take damage in Blasters is your head. When you see a circle of bullets, often the best thing to do is to keep your head right in the middle and let the bullets breeze right by you.','Blasters of the Universe is the first of its kind, bringing the bullet hell genre into first person VR. Intense gameplay is heavily reliant on physical movement, requiring the player to duck, dodge, twist, turn, and maneuver their way through tons of enemies and hundreds of bullets.','0','T',1,1,'https://store.steampowered.com/app/490490/Blasters_of_the_Universe/',0,1,'2021-10-28 16:06:19','2024-05-23 06:35:58','490490','',0,1,0,0,0),(183,'Blaston','blaston','Saddle up, partner, because this Blaston update is unlike any of the others -- the brand new western-themed “Quick Draw” update allows Blaston players to duel wild-west style! Duck, dodge & weave like Neo as you duel players & bots to rise to the top League with your loadout assembled from collected weapons in this competitive slow-motion bullet-hell of endless skill & depth from Resolution Games.','In the slow-motion bullet-hell of Blaston, you duck, dodge, and weave to evade incoming attacks while preparing your dazzling next combos in a flash of skill. You feel like Neo and leave each session with your heart racing in this super fun tactical workout. Most importantly... Never. Stay. Still.','0','T',1,4,'https://store.steampowered.com/app/1427890/Blaston/',0,1,'2021-10-28 16:09:24','2024-05-23 06:35:58','1427890','',0,1,1,0,0),(184,'BlockBusters VR','blockbusters-vr','The familiar mechanics of this casual tetromino block game will let anybody enjoy it in minutes. Three game modes will keep you entertained both in singe and in co-op with a friend. Designed by a virtual reality experience centre based on feedback from hundreds of customers. Our aim is to create an experience that is easy to onboard and can be enjoyable for all family members.','Overview: With simple controls and familiar mechanics, this casual fun game will get everyone in your family to enjoy it within minutes. Complete the lines by yourself or with a friend in LAN co-op mode and work towards higher points and better combos!','0','E',1,1,'https://store.steampowered.com/app/1393650/BlockBustersVR/',0,1,'2021-10-28 16:12:09','2024-05-23 06:35:58','1393650','',0,1,0,0,0),(185,'Blocks by Google','blocks-by-google','Blocks lets you easily create 3D objects in virtual reality, no matter your modelling experience. Using six simple tools, you can bring your applications to life, create a volumetric masterpiece, or simply let your imagination run wild. Get inspired by others’ creations or publish your own to inspire the world around you. No matter your modeling experience, you’ll create beautiful 3D objects in no time.','Blocks lets you easily create 3D objects in virtual reality, no matter your modelling experience. Using six simple tools, you can bring your applications to life, create a volumetric masterpiece, or simply let your imagination run wild.','0','E',1,1,'https://store.steampowered.com/app/533970/Blocks_by_Google/',0,1,'2021-10-28 16:15:08','2024-05-23 06:35:58','533970','',0,1,0,0,0),(186,'Blortasia','blortasia','Blortasia is an abstract art world in the sky. Fly freely through a surreal maze of evolving sculptures. Take a break from reality and explore an animated psychedelic sculpture park. Wander through the labyrinth, soar across the open space, or just hang out and let the mesmerizing ever-changing sculptures provide a rejuvenating refuge for your mind. Blortasia combines art and flying in virtual reality.','Blortasia is an abstract art world in the sky. Fly freely through a surreal maze of evolving sculptures. Take a break from reality and explore an animated psychedelic sculpture park. Blortasia combines art and flying in virtual reality.','0','E',1,1,'https://store.steampowered.com/app/497450/Blortasia/',0,1,'2021-10-28 16:18:26','2024-05-23 06:35:58','497450','',0,1,0,0,0),(187,'Bonfire','bonfire','The latest animated experience from the award-winning Baobab Studios. In Bonfire, you play the lead role in an interactive narrative. As Space Scout 817, you’re on a mission to discover a new home for the human race. Too bad your piloting skills lack… precision. You crash-land at night on a mysterious unknown planet three-hundred light-years from Earth. Your only source of light is your makeshift bonfire. Beyond its glow everything falls to darkness. And what are those strange noises coming from the alien jungle?','You’re Scout 817, a member of the not so elite Space Force. You’ve just crashed your spaceship on a strange planet. Your only tools for survival are a fading bonfire, a robot and a limited supply of nourishment cylinders. And what\'s that sneaking around out there in the dark alien jungle?','0','T',1,1,'https://store.steampowered.com/app/1232310/Bonfire/',0,1,'2021-10-28 16:20:20','2024-05-23 06:35:58','1232310','',0,1,0,0,0),(188,'Buddy Adventures: Attack of the Wompas!','buddy-adventures-attack-of-the-wompas','The objective of the game is to rescue Buddy from the misguided Wompas and from the King Wompa who wants to make Buddy his pet. To save Buddy, the player must defeat the Wompas using a variety of gadgets and weapons. Attack of the Wompas is kid-friendly entertainment that we think the whole family will enjoy.  The goal for this game is to create a completely new kind of VR experience—with handmade illustrations, original music, and animations—that stirs the underlying emotions of the players. The heightened sense of realism and level of immersion of the game make for a fun and exciting adventure.','Buddy Adventures – Attack of the Wompas™ VR is a highly immersive VR adventure game. The game is designed to have you use all of your wits and skills to rescue Buddy, Rocket’s flagship character, from a variety of wily, anthropomorphic opponents.','0','E',1,1,'https://springboardvr.com/marketplace/buddyadventures',0,1,'2021-10-28 16:24:53','2024-05-23 06:35:58','','',0,1,0,0,0),(189,'Bullets and More VR','bullets-and-more-vr','Enjoy an arsenal of more than 30 realistic behaving weapons in multiplayer and single-player: such as knives, rifles, grenades, RPGs, and even bows and support for attachments, silencers and even bipods. Also featuring support for player controlled helicopters and cars that can carry multiple passengers and a parachute in case you need to eject in mid air. The game is also featuring different singleplayer game modes and a Scene Editor with Workshop support.','Jump into an action packed multiplayer experience with up to 12 players and respawns without boring downtime. Featuring more than 40 unique maps and various game modes (BAM Royale, Deathmatch, Team Deathmatch, Capture The Flag, Virus Infection, Gun Game and Classic Deathmatch).','0','T',1,4,'https://store.steampowered.com/app/525640/Bullets_And_More_VR__BAM_VR/',0,1,'2021-10-28 16:30:26','2024-05-23 06:35:58','525640','',0,1,1,0,0),(190,'Calcflow','calcflow','','Manipulate vectors with your hands, explore vector addition and cross product. See and feel a double integral of a sinusoidal graph in 3D, a Mobius strip and it\'s normal or spherical coordinates! Create your own parametrized functions and vector fields!','0','E',1,1,'https://store.steampowered.com/app/547280/Calcflow/',0,1,'2021-10-28 17:09:58','2024-05-23 06:35:58','547280','',0,1,0,0,0),(192,'Cargo Cult: Shoot \'n\' Loot','cargo-cult-shootnloot-vr','Оn the ruins of the old world, among the picturesque fragments of civilization, the last ship of the Great Mechanical Armada wades deep into the territory of Cargo Cult to steal El Dorado. You\'re the captain. The world that has been destroyed and has revived from ashes. The world full of ancient wooden mechanisms and stone golems worshipping them, beautiful palms and deadly homing missiles. Fancy place that will never make you stop being surprised!','Have you ever dreamt of being a brave captain of air battleship ? Enter with us the world of total cargo cult! Battle against fast swarms of Iron Hornets, mad Kamikadze Ships, heavy and armored Doomcopters, merciless Missile Towers, and more. Shoot’n’Loot will give you all of these and even more!','0','T',1,1,'https://store.steampowered.com/app/565380/Cargo_Cult_ShootnLoot_VR/',0,1,'2021-10-28 17:25:53','2024-05-23 06:35:58','565380','',0,1,0,0,0),(193,'The Cave','the-cave','The Arcade game and have lots of fun in a \'quest for diamonds\' action game trying to collect as many diamonds as fast as you can on a dangerous plank while avoiding oscillating hanging wood logs. You have to try! The second option is an experience designed to make you feel sensations nearly impossible in real life without physical danger. It\'s not about puzzle or quiz games to achieve goals, it\'s about feeling. Feel, watch, hear and enjoy almost real sensations.','The Cave is a 2 in 1 VR bundle. An arcade game and a real world fear experience. Play the arcade option and hunt for diamonds over a dangerous plank while big oscillating logs try to hit you and make you fall down or live the fear of being trapped in a deep cave. A VR game/experience that won\'t disappoint you','0','E',1,1,'https://store.steampowered.com/app/723510/The_Cave_VR/',0,1,'2021-10-28 17:31:03','2024-05-23 06:35:58','723510','',0,1,0,0,0),(194,'Cave Digger','cave-digger','Cave Digger is a mining adventure game, which takes place in a small town of an alternative western universe full of mystery, dark humor and numerous experimental tools for the brave miners! Gear up to explore the town and the depths of the mountain. Excavate the bedrock, reap the rewards of mother earth and trade the mined valuables for new gadgets.','Cave Digger is a virtual reality mining game in an alternative western setting. Gear up with numerous unique tools and explore the town and the depths of the mountain. Discover secrets, easter eggs and multiple endings!','0','E',1,1,'https://store.steampowered.com/app/844380/Cave_Digger_VR/',0,1,'2021-10-28 17:53:40','2024-05-23 06:35:58','844380','',0,1,0,0,0),(195,'Chemistry VR','chemistry','Become a researcher in a scientific laboratory. Dive into solids and gases to learn about their structure on the atomic and molecular level. Construct any atom on your own with a special constructor and learn about electron configuration. Don’t memorize, understand! Immersing yourself in the subject of study makes it a lot easier to comprehend chemistry. Complex concepts become visual, and the ability to interact makes studying fun and entertaining.','MEL Chemistry is a course of chemistry lessons in virtual reality, made to fit the school curriculum, where virtual reality turns studying into an entertaining process for learning about the rudiments of chemistry, using scientific games and the immersion method.','0','E',1,1,'https://www.oculus.com/experiences/go/1457959427660729/?locale=en_US',0,1,'2021-10-28 17:55:12','2024-05-23 06:35:58','','',0,1,0,0,0),(196,'Chop it','chop-it','Included are 8 playable songs custom written for Chop It by Strange Handle AV. Import your own content and map songs manually, procedurally, or a mix of the two in the VR Mapping Station. One of the things that makes Chop It unique from other VR rhythm games is the use of true roomscale where the Sensei jumps and flies around the environment while throwing items at you that land to the beat.','Chop It is a VR rhythm game about karate and friendship. Be karate. Gaze in awe as the Sensei launches himself around the Pagoda raining building materials on your head.','0','E',1,1,'https://store.steampowered.com/app/812580/Chop_It/',0,1,'2021-10-28 17:56:21','2024-05-23 06:35:58','812580','',0,1,0,0,0),(198,'Chroma Lab','chroma-lab','A colorful fluid simulation to play with in VR. Chroma Lab is based around a high performance, custom particle physics engine that utilises the vast computing power of modern GPUs to calculate billions of individual forces per second between the particles, necessary for them to interact with each other and behave like a fluid. There is a variety of tools to interact with the particles as well as a well featured options menu that allows you to customise the visuals, physics and save/load scenes.','Chroma Lab is a VR particle physics sandbox. Surround yourself with hundreds of thousands of colorful particles that stick together like a fluid which you can interact with using a variety of tools.','0','E',1,1,'https://store.steampowered.com/app/587470/Chroma_Lab/',0,1,'2021-10-29 17:36:46','2024-05-23 06:35:58','587470','',0,1,0,0,0),(199,'Cloudlands 2','cloudlands-2','Cloudlands 2 builds off of the fun of playing and building minigolf courses and adds the ability to play full sized golf courses. Arm yourself with a putter, wedge, and driver and hit the links in the clouds. - 54-hole single player campaign takes you through the Green Glades, Magic Meadows, and Reaper Ruins. Play 18 hole mixes of full sized golf and minigolf. - Level Editor with over 1000 pieces to build and make epic mini golf or full golf holes. Create and upload your creations to allow other people to play. - Expect to find a nearly unlimited supply of amazing user created levels. All existing Cloudlands 1 holes are available to play (2000+). - Online Multiplayer allows up to 4 players to play together. Create a room, have your friends join, and off you go. - Local Multiplayer pass and play allows you and your friends to play together by passing one headset between you. - In-game voice chat fully supported.','Award winning Cloudlands: VR Minigolf has an official sequel that\'s bigger and better than ever. Cloudlands 2 builds off of the fun of playing and building minigolf courses and adds the ability to play full sized golf courses. Arm yourself with a putter, wedge, and driver and hit the links in the clouds.','0','E',1,1,'https://store.steampowered.com/app/1206960/Cloudlands_2/',0,1,'2021-10-29 17:41:29','2024-05-23 06:35:58','1206960','',0,1,0,0,0),(200,'Coffin Rot Brewing Co.','coffin-rot-brewing-co','','Pick up where your father left off -- bartending for the undead! It\'s not all sloshing grog and wiping tables at this bar because your dad also left you a considerable debt, and someone\'s coming to collect...','0','T',1,1,'https://store.steampowered.com/app/1112690/Coffin_Rot_Brewing_Co/',0,1,'2021-10-29 17:45:49','2024-05-23 06:35:58','1112690','',0,1,0,0,0),(201,'Conductor','conductor','Conductor is a action-adventure, puzzle game. Take control of a locomotive and clear anything that stands in your way. Solve puzzles by using tools and wit. Defend yourself from the forces of Overcorp.','','0','E',1,1,'https://store.steampowered.com/app/584930/Conductor/',0,1,'2021-10-29 17:48:18','2024-05-23 06:35:58','584930','',0,1,0,0,0),(202,'Conjuror\'s Eye','conjurors-eye','You play as a wizard who receives a package from an old friend and gets sucked into a constantly shrinking enchanted artifact. Inside, scattered magic puzzles must be solved before the room collapses. Using a newly learned scaling spell, you are able to shrink and expand objects at a distance. After managing to solve these puzzles, another artifact awaits, leading to a deeper dimension of itself, with more puzzles to solve. Will you survive?','While studying a new shrinking spell, a wizard receives a package from an old friend, but doesn’t adhere to the warning attached.','0','E',1,1,'https://store.steampowered.com/app/805320/Conjurors_Eye/',0,1,'2021-10-29 17:53:56','2024-05-23 06:35:58','805320','',0,1,0,0,0),(203,'Cook-Out','cook-out','Set within the cook’s cabin of a fairytale forest, Cook-Out: A Sandwich Tale is a wacky and whimsical adventure - brought to you by the creators of Angry Birds VR: Isle of Pigs, Bait! and Blaston - that challenges up to four players to work together to keep the orders coming for a hungry cast of enchanted creatures in this multiplayer VR game. Set within the cook’s cabin of a fairytale forest, Cook-Out: A Sandwich Tale is a wacky and whimsical adventure - brought to you by the creators of Angry Birds VR: Isle of Pigs, Bait! and Blaston - that challenges up to four players to work together to keep the orders coming for a hungry cast of enchanted creatures in this multiplayer VR game.','Get your aprons ready… things are about to get messy in this award-winning multiplayer VR cooking game from Resolution Games!','0','E',1,4,'https://store.steampowered.com/app/1523720/CookOut/',0,1,'2021-10-29 18:06:17','2024-05-23 06:35:58','1523720','',0,1,1,0,0),(204,'Cosmic Trip','cosmic-trip','','Built exclusively for VR, Cosmic Trip is an award-winning real-time strategy game for the HTC Vive, Oculus Rift/S, Valve Index and Windows MR headsets. Build a base, command a drone army, and attack/defend hostile enemies on strange alien planets.','0','T',1,1,'https://store.steampowered.com/app/427240/Cosmic_Trip/',0,1,'2021-10-29 18:10:45','2024-05-23 06:35:58','427240','',0,1,0,0,0),(205,'Cow Milking Simulator','cow-milking-simulator','Forget what you have learnt in school. Milk does not come from boxes! And now you have the chance to participate on this ancient farm process (at least virtually).\r\n\r\nCow Milking Simulator is a whimsical arcade game. Your mission: milk the cow as fast as you can! Get the milk, sell some dairies, eat cheese, make money. But you have to be quick: a farmer\'s life is not as chill as you would think!\r\n\r\nCow Milking is a party game in virtual reality, ideal to play and pass with friends, making it a perfect game to show VR for the first time. Collect new products, new hats for your cow and don\'t forget to milk as fast as you can to mark your name in (leaderboards) history!','Cow Milking Simulator is a whimsical arcade game. Your mission: milk the cow as fast as you can! Get the milk, sell some dairies, eat cheese, make money. But you have to be quick: a farmer\'s life is not as chill as you would think!','0','E',1,1,'https://store.steampowered.com/app/624710/Cow_Milking_Simulator/',0,1,'2021-10-29 18:13:30','2024-05-23 06:35:58','624710','',0,1,0,0,0),(206,'Crisis VRigade','crisis-vrigade','Crisis VRigade is a virtual reality action filled first person shooter that lets players take on the role of a SWAT trooper and deal with terrorist situations. Play solo or team with your friends with the coop multiplayer mode.\r\n\r\nDuty calls! You’re put in the middle of the action. It\'s a dirty job but someone has to do it. Together with a SWAT team you will have to deal with the situation and take care of the terrorists who are robbing the bank. Your mission is crystal clear: finish off all hostile elements and keep your teammates and hostages alive. Make your way through the bank to the safe where the terrorist have made a stronghold and threaten to kill the hostages if their demands are not met.\r\n\r\nBe aware of your ammunition and take cover while reloading your gun or you will be exposed and the mission over: maybe you see the bullet comming, maybe you didn’t,\r\nbut the terrorist got away and your partners now have the unpleasant task of giving the bad news to your nearest relative.\r\n\r\nEveryone counts on you and your first-of-the-class aim. You got the highest rates at the academy, it’s time to prove it!','Crisis VRigade is a virtual reality action filled first person shooter that lets players take on the role of a SWAT trooper and deal with terrorist situations. Play solo or team with your friends with the coop multiplayer mode.','0','T',1,1,'https://store.steampowered.com/app/939000/Crisis_VRigade/',0,1,'2021-10-29 19:19:54','2024-05-23 06:35:58','939000','',0,1,0,0,0),(207,'Crisis VRigade 2','crisis-vrigade-2','Crisis VRigade 2 is a Fast-Paced Virtual Reality Action Shooter that lets players take on the role of a SWAT trooper. Play solo or team with your friends with the co-op Multiplayer mode!\r\n\r\nDuty calls again! Crisis VRigade 2 takes up the baton of the first chapter and takes it to the next level: more action, more shootouts, more weapons, more difficulty, more blood, more everything!\r\n\r\nIf you liked Crisis VRigade, you\'ll love Crisis VRigade 2. If you haven\'t played Crisis VRigade, you\'ll love Crisis VRigade 2.','Crisis VRigade 2 is a Fast-Paced Virtual Reality Action Shooter that lets players take on the role of a SWAT trooper. Play solo or team with your friends with the co-op Multiplayer mode!','0','T',1,1,'https://store.steampowered.com/app/1066180/Crisis_VRigade_2/',0,1,'2021-10-29 19:21:59','2024-05-23 06:35:58','1066180','',0,1,0,0,0),(208,'Crow: The Legend','crow-the-legend','Starring John Legend, Oprah Winfrey, Constance Wu (Crazy Rich Asians), Tye Sheridan (Ready Player One), Diego Luna (Rogue One: A Star Wars Story), and Liza Koshy. Created by the director of Madagascar and the Emmy-winning animated films Invasion! and Asteroids!\r\nIn this interactive animation, Crow is the most admired animal in the forest with his magnificent colors and beautiful 