erence images or live, in-game web feeds to have art jams with your class or meetup group.\r\nCreate collaboratively with friends or colleagues or teach others in real time immersively in the same virtual space.  \r\nPerform and demonstrate using advanced Mixed Reality and room camera display features.\r\nUse the Display Cam to show your work from a third party POV.','','0','E',1,4,'',0,1,'2021-12-04 20:20:58','2024-05-23 06:35:59','','https://operator.springboardvr.com/content/library/b9695510-5081-11ec-8ec0-3576304b5806/details',0,1,1,0,0),(301,'Masters of Design','masters-of-design','You say you’re learning about engineering design? Well, put on the headset and join us in China as you stand on the Great Wall of China and see how The Great Wall winds its way through the mountains of China. Even more, learn how the invading Mongols from the north caused China to undertake this engineering marvel. \r\nThis unit - Masters of Design - is set in a mountain-based research facility which takes you on an amazing journey through design and engineering. \r\nOur Manga comic book in a dark virtual reality room, takes you through the discoveries of Thomas Edison as he learned to harness electricity. While you’re in the room, be sure to set the vintage radio to your favorite classical station. \r\nFly among the clouds in our learning game as you take off and soar through the skies. When presented with questions, just lean in and dive or rise toward the correct answer. This game is fast-paced and an adrenaline rush. \r\nEver stood in the middle of a winter snow storm? Wendy the Science Teacher takes us out into the snow as she explains the science of making snow. \r\nYou will also enjoy a visually engaging story about solar cars. The engineering challenges of solar powered cars gives us a fascinating under the hood look at how they work and the impact they might have on our future.','','0','E10+',1,1,'',0,1,'2021-12-04 20:27:30','2024-05-23 06:35:59','','https://operator.springb