le of Aluxes by solving various puzzles and challenges.','','0','T',1,1,'https://store.steampowered.com/app/700620/Temple_of_Aluxes/',0,1,'2022-02-21 16:17:11','2024-05-23 06:35:59','700620','',0,1,0,0,0),(378,'Tennis Kings VR','tennis-kings-vr','Experience the feeling of tennis in your home! Tennis Kings is a VR-sport game which you can experience a life-like tennis play in virtual reality applied realistic physical ball movement and spinning.','','0','E',1,1,'https://store.steampowered.com/app/802320/Tennis_Kings_VR/',0,1,'2022-02-21 16:19:09','2024-05-23 06:35:59','802320','',0,1,0,0,0),(379,'The Bellows','the-bellows','The Bellows is a VR Horror experience designed to play like an interactive movie. Plunge yourself into a world of nightmares and fear, and discover just how frightening the past can really be.','','0','T',1,1,'https://store.steampowered.com/app/529670/The_Bellows/',0,1,'2022-02-21 16:22:52','2024-05-23 06:35:59','529670','',0,1,0,0,0),(380,'Cooking Simulator VR','cooking-simulator-vr','Become the ultimate chef in VR! Take control of a highly polished, realistic kitchen equipped with all kinds of utensils and stands. Unlock and master over 80 recipes or use dozens of lifelike ingredients to cook everything you like. A simulator spiced up with a dash of real-life physics!','','0','E',1,1,'https://store.steampowered.com/app/1358140/Cooking_Simulator_VR/',0,1,'2022-02-21 17:35:07','2024-05-23 06:35:59','1358140','',0,1,0,0,0),(381,'The Experiment: Escape Room','the-experiment-escape-room','\"The Experiment\" is a multiplayer escape room puzzle game for virtual reality or desktop PC! You took part in an experiment that went out of control, can you escape the facilities before it\'s too late?','','0','T',1,4,'https://store.steampowered.com/app/977570/The_Experiment_Escape_Room/',0,1,'2022-02-21 17:37:42','2024-05-23 06:35:59','977570','',0,1,1,0,0),(382,'The Great C','the-great-c','Based on the sci-fi short story by Philip K. Dick, The Great C is a cinematic narrative featuring a thrilling storyline, stunning environments and a powerful soundtrack. The Great C is a sweeping 30+ minute experience, developed from the ground up to push the boundaries of storytelling in VR.','','0','T',1,1,'https://store.steampowered.com/app/841460/The_Great_C/',0,1,'2022-02-21 17:43:22','2024-05-23 06:35:59','841460','',0,1,0,0,0),(383,'The Haunted Graveyard','the-haunted-graveyard','A spooky VR adventure game welcoming to all ages with a beautiful soundtrack, great graphics with amazing voice acting.\r\nThis game will have you stroll through a graveyard at light with a very Tim Burton feeling to it.','','0','E',1,1,'https://store.steampowered.com/app/931930/The_Haunted_Graveyard/',0,1,'2022-02-26 19:17:03','2024-05-23 06:35:59','931930','',0,1,0,0,0),(384,'The Impossible Travel Agency','the-impossible-travel-agency','Travel to a distant world pulsing with life in this beautiful VR experience set to music.','','0','E',1,1,'https://store.steampowered.com/app/460990/The_Impossible_Travel_Agency/',0,1,'2022-02-26 19:46:32','2024-05-23 06:35:59','460990','',0,1,0,0,0),(385,'The Invisible Hours','the-invisible-hours','The Invisible Hours is a complex murder mystery in VR, in which players freely explore an intricate web of interwoven stories within a sprawling mansion. This is not a game. This is not a movie. This is a piece of immersive theatre with many tangled threads.','','0','T',1,1,'https://store.steampowered.com/app/582560/The_Invisible_Hours/',0,1,'2022-02-26 19:51:58','2024-05-23 06:35:59','582560','',0,1,0,0,0),(386,'test adasd','test-adasd','','','0','',1,1,'',0,1,'2024-05-23 06:20:55','2024-05-23 06:20:55','','',0,0,0,0,0),(387,'test adasd','test-adasd','','','0','',1,1,'',0,1,'2024-05-23 06:21:03','2024-05-23 06:21:03','','',0,0,0,0,0),(388,'test adasd','test-adasd','','','0','',1,1,'',0,1,'2024-05-23 06:25:05','2024-05-23 06:25:05','','',0,0,0,0,0),(389,'another test','another-test','','','0','',1,1,'',0,1,'2024-05-23 06:27: